import React from 'react';
import ReactDOM from 'react-dom';
import Button from 'react-bootstrap/Button';
import './buttons_right.css';

class ButtonsRight extends React.Component{

  render(){
    return(
      <div className="mx-auto col-6 d-block">
       <Button className="button1" variant="primary" size="lg">
        <b>הזמנה דרך האתר</b>
       </Button>
       <Button className="button2" variant="primary" size="lg">
        <b>Club Card</b>
       </Button>
       <img className="img-hever"src={"../../images/hever.jpg"} alt="heverClub" />
      </div>
    )
  }
}

export default ButtonsRight;
